import React from 'react'
import { Card, Avatar } from 'antd';


const UserProfile = () => {

  return (
    <div>
      <Card
        img
      >

      <Card.Meta 
      avatar={<Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />}
      title="Junho"
      description="NodeBird"
       />
      </Card>
    </div>
  )
}

export default UserProfile
